import "./App.css";

import React, { useContext } from "react";
import { Routes, Route, Navigate } from "react-router-dom";

// import Editor from "./components/code_editor/editor";
import NavBar from "./features/navbar/navbar";
import NotFound from "./features/404/404";
import SignIn from "./features/auth/signin";
import SignUp from "./features/auth/signup";
import { AuthContext, PrivateRoute } from "./authContext";
import Labs from "./features/labs/labs";
import Home from "./features/home/home";

export default function App() {
  const {currentUser} = useContext(AuthContext);
  return (
    <>
      {currentUser ? <NavBar /> : ""}
      <Routes>
        <Route exact path = "/" element={<PrivateRoute><Home /></PrivateRoute>} />
        <Route path = "/home" element={<PrivateRoute><Home /></PrivateRoute>} />
        <Route path="/login" element={currentUser? <SignIn /> : <Navigate to="/" replace="true" />} />
        <Route path="/register" element={<SignUp />} />
        <Route path="/labs" element={ <PrivateRoute> <Labs /> </PrivateRoute> } />
        {/* <PrivateRoute exact path="/lab/:lab_id" element={<LabDefault />} />
        <PrivateRoute
          path="/lab/:lab_id/problem/:problem_id"
          element={<Editor />}
        /> */}
        <Route element={<NotFound />} />
      </Routes>
    </>
  );
}
